def max_distinct_elements(arr, K):
    hashmap = {}
    maxheap = []
    for num in arr:
        if num in hashmap:
            hashmap[num] += 1
        else:
            hashmap[num] = 1
    for value in hashmap.values():
        h.heappush(maxheap, -value)
    while K > 0 or maxheap:
        temp = -h.heappop(maxheap)
        temp -= 1
        K -= 1
        if temp > 0:
            h.heappush(maxheap, -temp)
    return len(maxheap)

